    if len(a) < 2 or not a[:-1].isdigit() or not a[-1].isalpha():
        return 'No Seat!!'

    number = int(a[:-1])
    letter = a[-1].upper()

    if number < 1 or number > 60 or letter in 'IJ':
        return 'No Seat!!'

    if 1 <= number <= 20:
        section = 'Front'
    elif 21 <= number <= 40:
        section = 'Middle'
    else:
        section = 'Back'

    if letter in 'ABC':
        cluster = 'Left'
    elif letter in 'DEF':
        cluster = 'Middle'
    else:
        cluster = 'Right'

    return f"{section}-{cluster}"
```

